import React from "react";
import { Link } from 'react-scroll'

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { fab } from '@fortawesome/free-brands-svg-icons'
import { faCanadianMapleleaf } from '@fortawesome/free-solid-svg-icons'
import "../components/Menu.scss";


export default function Menu() {

  const element = <FontAwesomeIcon icon = { faCanadianMapleleaf } />

  return (
      <li className = "Menu"> 
      { element }
      <Link to = "about" spy = {true} smooth = {true} > 
        <h2 className = "Menu--item" > About Me </h2>
      </Link>
      <Link to = "project" spy = {true} smooth = {true} > 
        <h2 className = "Menu--item" > Projects </h2>
      </Link>
      <Link to = "contact" spy = {true} smooth = {true} > 
        <h2 className = "Menu--item" > Contact </h2>
      </Link>
      </li>
  )
}
